export const SearchView = (props) => {
  return (
    // <h1>{props.data[0]}</h1>
    <div>
    <input list="Users" name="userSearch"/>
    <datalist id="userList">
    {() => {
      const userOptions = [];
      for (let i = 0; i < props.data.length; i++){
        userOptions.push(<option value={props.data[i]}/>)
      }
    }}
    </datalist>
    </div>
  )
}
